import React from 'react';
import { Card, CardBody } from 'reactstrap';

function Header()
{
    return(
        <div>
            <Card className="my-2 bg-primary">
                <CardBody>
                <h1 className="text-center my-3">Welcome to Labour Management System</h1>
                </CardBody>
            </Card>
            
        </div>
    );
}
export default Header;
